import React from 'react'

export const GifGrid = ({category}) => {

    const getGifs = () => {
        const url = 'api.giphy.com/v1/gifs/search?q=Rick and morty&limit=10&api_key=tfRgcwv7vxAyL3vMQapLiD0NQw3148nH';
    }

    return (
        <>
            <h3>{category}</h3>
        </>
    )
}
